import http from "../service/httpService";
const apiEndpoint = "http://localhost:3030/api";

export function getWorshippers() {
  return http.get(apiEndpoint + "/worshippers");
}

export function deleteWorshippers(WorshippersId) {
  return http.delete(apiEndpoint + "/worshippers/" + WorshippersId);
}
